backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    # Optionally add encryption
    encrypt = false
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./random_postfix.tf.code:
provider "random" {}

resource "random_string" "postfix" {
  length  = 3
  special = false
  upper   = false
  number  = true
}

./ssm_parameter.tf.code:
resource "aws_ssm_parameter" "parameter_from_CloudAI" {
  name        = "parameter_from_CloudAI_${random_string.postfix.result}"
  description = "Parameter managed by CloudAI with a unique postfix"
  type        = "String"
  value       = "MyParameterValue" # Add the desired parameter value here.

  tags = {
    "owner" = "jeremy_wang"
  }
}
